#include<iostream>
#include<unordered_map>
using namespace std;

class Solution {
public:
    char findTheDifference(string s, string t) {

        unordered_map<char, int> dp, dp2;
        for (char& c : s){
            dp[c]++;
        }
        for (char& c2 : t){
            dp2[c2]++;
        }
        for (char& c : t){
            if (dp[c] != dp2[c]){
                return c;
            }
        }
        return 0;
    }

};


int main(){
    Solution s;
    string str,t;

    str = "";
    t = "";
    char result = s.findTheDifference(str,t);
    // print the result
    cout << result << endl;

    return 0;
}